         </div>
        
         <div className='header__right'>
             {/* <div className="header__home"></div>
             <div className="header__mynetworks"></div>
             <div className="header__jobs"></div>
             <div className="header__messaging"></div>
             <div className="header__notification"></div>
             <div className="header__me"></div> */}
             <HeaderOption title='Home'/>
             <HeaderOption title='My Neetwork'/>
             <HeaderOption title='Jobs'/>
             <HeaderOption title='Messaging'/>
             <HeaderOption title='Notifications'/>
             <HeaderOption title='Me'/>
         </div>
     </div>
  </div>);
};

export default Header;
